import React, { useState, useEffect } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, Area, AreaChart } from 'recharts';

const TelemetryCharts = ({ telemetry }) => {
  const [chartData, setChartData] = useState([]);
  const [activeTab, setActiveTab] = useState('altitude');

  useEffect(() => {
    if (telemetry.timestamp) {
      const newDataPoint = {
        timestamp: new Date(telemetry.timestamp * 1000).toLocaleTimeString(),
        altitude: telemetry.alt || 0,
        speed: telemetry.groundspeed || 0,
        battery: telemetry.battery_voltage || 0,
        batteryPercent: telemetry.battery_remaining || 0,
      };

      setChartData(prev => {
        const updated = [...prev, newDataPoint];
        return updated.slice(-20); // Keep last 20 points
      });
    }
  }, [telemetry]);

  const chartConfig = {
    altitude: {
      key: 'altitude',
      color: '#10B981',
      icon: 'üèîÔ∏è',
      title: 'Altitude',
      unit: 'm'
    },
    speed: {
      key: 'speed',
      color: '#3B82F6',
      icon: '‚ö°',
      title: 'Speed',
      unit: 'm/s'
    },
    battery: {
      key: 'battery',
      color: '#F59E0B',
      icon: 'üîã',
      title: 'Battery Voltage',
      unit: 'V'
    }
  };

  const currentConfig = chartConfig[activeTab];

  return (
    <div className="bg-gray-800 rounded-xl border border-gray-700">
      {/* Chart Header */}
      <div className="flex items-center justify-between p-4 border-b border-gray-700">
        <div className="flex items-center space-x-3">
          <div className="p-2 bg-blue-500/20 rounded-lg">
            <span className="text-lg">{currentConfig.icon}</span>
          </div>
          <div>
            <h3 className="text-white font-semibold">Telemetry Charts</h3>
            <p className="text-gray-400 text-sm">Real-time data visualization</p>
          </div>
        </div>
        
        {/* Chart Type Selector */}
        <div className="flex space-x-1 bg-gray-700 rounded-lg p-1">
          {Object.entries(chartConfig).map(([key, config]) => (
            <button
              key={key}
              onClick={() => setActiveTab(key)}
              className={`px-3 py-1.5 rounded-md text-sm font-medium transition-all ${
                activeTab === key
                  ? 'bg-blue-500 text-white shadow-lg'
                  : 'text-gray-400 hover:text-white'
              }`}
            >
              {config.title}
            </button>
          ))}
        </div>
      </div>

      {/* Chart Container */}
      <div className="p-4 h-64">
        <ResponsiveContainer width="100%" height="100%">
          <AreaChart data={chartData}>
            <defs>
              <linearGradient id="colorValue" x1="0" y1="0" x2="0" y2="1">
                <stop offset="5%" stopColor={currentConfig.color} stopOpacity={0.3}/>
                <stop offset="95%" stopColor={currentConfig.color} stopOpacity={0}/>
              </linearGradient>
            </defs>
            
            <CartesianGrid strokeDasharray="3 3" stroke="#374151" vertical={false} />
            <XAxis 
              dataKey="timestamp" 
              stroke="#9CA3AF"
              fontSize={12}
              tickLine={false}
              axisLine={false}
            />
            <YAxis 
              stroke="#9CA3AF"
              fontSize={12}
              tickLine={false}
              axisLine={false}
              width={40}
            />
            <Tooltip
              contentStyle={{
                backgroundColor: '#1F2937',
                border: '1px solid #374151',
                borderRadius: '8px',
                color: 'white'
              }}
              labelStyle={{ color: '#D1D5DB' }}
            />
            <Area
              type="monotone"
              dataKey={currentConfig.key}
              stroke={currentConfig.color}
              fill="url(#colorValue)"
              strokeWidth={2}
              dot={false}
              activeDot={{ r: 4, fill: currentConfig.color }}
            />
          </AreaChart>
        </ResponsiveContainer>
      </div>

      {/* Chart Footer */}
      <div className="p-4 bg-gray-700/50 border-t border-gray-600">
        <div className="grid grid-cols-3 gap-4 text-sm">
          <div className="text-center">
            <div className="text-gray-400">Current</div>
            <div className="text-white font-medium" style={{ color: currentConfig.color }}>
              {chartData.length > 0 
                ? `${chartData[chartData.length - 1][currentConfig.key]}${currentConfig.unit}`
                : `0${currentConfig.unit}`
              }
            </div>
          </div>
          <div className="text-center">
            <div className="text-gray-400">Average</div>
            <div className="text-white font-medium">
              {chartData.length > 0 
                ? `${(chartData.reduce((sum, point) => sum + point[currentConfig.key], 0) / chartData.length).toFixed(1)}${currentConfig.unit}`
                : `0${currentConfig.unit}`
              }
            </div>
          </div>
          <div className="text-center">
            <div className="text-gray-400">Data Points</div>
            <div className="text-white font-medium">{chartData.length}</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TelemetryCharts;
